-- ----------------------------
-- Table structure for mt_alipay_trade
-- ----------------------------
DROP TABLE IF EXISTS `mt_alipay_trade`;
CREATE TABLE `mt_alipay_trade`  (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `out_trade_no` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '商户网站唯一订单号',
  `out_biz_no` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '商户业务号，主要是退款通知中返回退款申请的流水号',
  `subject` varchar(256) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '订单标题',
  `trade_no` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '支付宝交易号',
  `trade_status` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '交易状态 交易目前所处的状态。成功状态的值只有两个：TRADE_FINISHED（普通即时到账的交易成功状态）；TRADE_SUCCESS（开通了高级即时到账或机票分销产品后的交易成功状态）',
  `gmt_create` timestamp(0) NULL DEFAULT NULL COMMENT '交易创建时间',
  `gmt_payment` timestamp(0) NULL DEFAULT NULL COMMENT '交易付款时间',
  `gmt_close` timestamp(0) NULL DEFAULT NULL COMMENT '交易关闭时间',
  `gmt_refund` timestamp(0) NULL DEFAULT NULL COMMENT '退款时间',
  `refund_status` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '退款状态 REFUND_SUCCESS:退款成功；REFUND_CLOSED:退款关闭',
  `notify_time` timestamp(0) NULL DEFAULT NULL COMMENT '通知时间',
  `seller_id` varchar(128) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '卖家支付宝账户号',
  `buyer_id` varchar(128) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '买家支付宝账户号',
  `refund_fee` decimal(10, 2) NULL DEFAULT NULL COMMENT '总退款金额',
  `total_amount` decimal(10, 2) NULL DEFAULT NULL COMMENT '订单金额（元）',
  `body` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '商品描述',
  `create_time` timestamp(0) NULL DEFAULT CURRENT_TIMESTAMP(0) COMMENT '创建时间',
  `update_time` timestamp(0) NULL DEFAULT CURRENT_TIMESTAMP(0) ON UPDATE CURRENT_TIMESTAMP(0) COMMENT '修改时间',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE INDEX `outTradeNo`(`out_trade_no`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 17 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '支付宝订单表' ROW_FORMAT = Compact;

-- ----------------------------
-- Records of mt_alipay_trade
-- ----------------------------

-- ----------------------------
-- Table structure for mt_cash_flow
-- ----------------------------
DROP TABLE IF EXISTS `mt_cash_flow`;
CREATE TABLE `mt_cash_flow`  (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `merchant_guid` bigint(20) NOT NULL COMMENT '商户guid',
  `seller_nick` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '公司名称',
  `cash_type` int(11) NOT NULL DEFAULT 0 COMMENT '变动类型 1、保证金充值 2、保证金锁定 3. 保证金回填',
  `type` int(1) NOT NULL DEFAULT 0 COMMENT '1增加  2扣减',
  `current_balance` decimal(10, 2) UNSIGNED NOT NULL DEFAULT 0.00 COMMENT '当前（可用）余额   单位 分',
  `change_balance` decimal(10, 2) UNSIGNED NOT NULL DEFAULT 0.00 COMMENT '增减额度   单位 分',
  `channel` tinyint(1) NOT NULL DEFAULT -1 COMMENT '资金渠道，0：系统操作；1：线下转账；2：支付宝支付；',
  `trade_no` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '商户订单号(out_trade_no、mch_billno、partner_trade_no)',
  `plan_guid` bigint(20) NOT NULL DEFAULT 0 COMMENT '关联计划guid',
  `log_push_plan_guid` bigint(20) NOT NULL DEFAULT 0 COMMENT '计划推送日志id',
  `remark` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '备注',
  `create_time` datetime(0) NULL DEFAULT CURRENT_TIMESTAMP(0) COMMENT '创建时间',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `tradeNo`(`trade_no`) USING BTREE,
  INDEX `type`(`type`) USING BTREE,
  INDEX `createTime`(`create_time`) USING BTREE,
  INDEX `merchantGuid`(`merchant_guid`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 13 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '商户资金流水表' ROW_FORMAT = Compact;

-- ----------------------------
-- Records of mt_cash_flow
-- ----------------------------

-- ----------------------------
-- Table structure for mt_cash_recharge_trade
-- ----------------------------
DROP TABLE IF EXISTS `mt_cash_recharge_trade`;
CREATE TABLE `mt_cash_recharge_trade`  (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键自增',
  `merchant_guid` bigint(20) NOT NULL COMMENT '商户guid',
  `seller_nick` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '公司名称',
  `mobile` varchar(11) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '商户手机号',
  `out_trade_no` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '商户网站唯一订单号',
  `trade_no` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '支付宝交易号',
  `buyer_id` varchar(128) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '买家(商户)支付宝账户号',
  `pay_way` tinyint(2) NOT NULL DEFAULT -1 COMMENT '支付方式，0:系统操作；1：线下转账；2：支付宝；',
  `type` tinyint(2) NOT NULL DEFAULT 0 COMMENT '类型 1: 充值；2:赠送',
  `recharge_fee` decimal(10, 2) NOT NULL DEFAULT 0.00 COMMENT '充值金额(元)',
  `pay_time` datetime(0) NULL DEFAULT NULL COMMENT '付款时间',
  `is_audit` tinyint(1) NOT NULL DEFAULT 0 COMMENT '财务审核状态，0：待审核；1：审核成功；2：审核失败',
  `is_recharge` tinyint(1) NOT NULL DEFAULT 0 COMMENT '订单充值状态，0：未充值；1：已充值；',
  `trade_image_url` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '凭证图片',
  `invoice_info` varchar(200) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '开票主体',
  `remark` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '备注',
  `create_time` datetime(0) NULL DEFAULT CURRENT_TIMESTAMP(0) COMMENT '创建时间',
  `update_time` datetime(0) NULL DEFAULT CURRENT_TIMESTAMP(0) ON UPDATE CURRENT_TIMESTAMP(0) COMMENT '更新时间',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE INDEX `outTradeNo`(`out_trade_no`) USING BTREE,
  INDEX `tradeNo`(`trade_no`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 38 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '商户资金充值订单表' ROW_FORMAT = Compact;

