-- Table structure for mt_plan_temp
-- ----------------------------
DROP TABLE IF EXISTS `mt_plan_temp`;
CREATE TABLE `mt_plan_temp`  (
  `id` bigint(11) NOT NULL COMMENT '主键',
  `plan_id` bigint(11) NOT NULL COMMENT '计划ID',
  `plan_guid` bigint(20) NOT NULL DEFAULT 0 COMMENT '全局唯一guid 用作计划编号',
  `plan_name` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '计划名称',
  `merchant_guid` bigint(20) NOT NULL DEFAULT 0 COMMENT '商户guid',
  `shop_id` bigint(20) NOT NULL DEFAULT 0 COMMENT '店铺ID',
  `trade_ids` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '行业ID',
  `pro_type` tinyint(2) NOT NULL COMMENT '推广类型（1：推券，2：入会，3：加购）',
  `coupon_ids` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '优惠券表ID 多张优惠券用 , 分隔',
  `good_ids` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '商品ID 多个商品用 , 分隔',
  `signature` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '签名',
  `pro_way` tinyint(2) NOT NULL DEFAULT 0 COMMENT '推广方式；1为微信个人，2为广告位投放',
  `start_time` datetime(0) NULL DEFAULT NULL COMMENT '推广开始时间',
  `end_time` datetime(0) NULL DEFAULT NULL COMMENT '推广结束时间',
  `target_click` int(11) NOT NULL COMMENT '单日目标数',
  `lowest_price` decimal(10, 2) NOT NULL DEFAULT 0.00 COMMENT '点击低价',
  `highest_price` decimal(10, 2) NOT NULL DEFAULT 0.00 COMMENT '出价上限',
  `increment_price` decimal(10, 2) NOT NULL DEFAULT 0.00 COMMENT '加价幅度',
  `status` tinyint(1) NOT NULL DEFAULT 0 COMMENT '计划状态；1是启用状态，0是禁用状态',
  `delete_flag` tinyint(1) NULL DEFAULT 0 COMMENT '软删除；1已删除，0是未删除',
  `create_time` datetime(0) NULL DEFAULT NULL COMMENT '创建日期',
  `update_time` datetime(0) NULL DEFAULT NULL COMMENT '修改日期',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `plan_id`(`plan_id`) USING BTREE COMMENT '计划列表Id',
  INDEX `plan_guid`(`plan_guid`) USING BTREE COMMENT '计划列表唯一Id',
  INDEX `merchant_guid`(`merchant_guid`) USING BTREE COMMENT '商户表唯一Id',
  INDEX `shop_id`(`shop_id`) USING BTREE COMMENT '店铺Id'
) ENGINE = InnoDB CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '计划列表' ROW_FORMAT = Compact;

