  INDEX `seller_id`(`seller_id`) USING BTREE COMMENT '卖家id',
  INDEX `merchant_guid`(`merchant_guid`) USING BTREE COMMENT '商户Id，一个商户会有多个店铺'
) ENGINE = InnoDB AUTO_INCREMENT = 3 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '店铺信息表' ROW_FORMAT = Compact;

