-- ----------------------------
-- Table structure for sys_user_merchant
-- ----------------------------
DROP TABLE IF EXISTS `sys_user_merchant`;
CREATE TABLE `sys_user_merchant`  (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `guid` bigint(20) NOT NULL COMMENT '商户生成的唯一标识',
  `third_platform_id` bigint(20) NOT NULL DEFAULT 0 COMMENT '第三方id（多谋联盟，达人互动）',
  `company_id` bigint(20) NOT NULL DEFAULT 0 COMMENT '公司id',
  `company_name` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '公司名称',
  `trade_id` bigint(20) NOT NULL DEFAULT 0 COMMENT '行业id',
  `trade_name` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '行业name',
  `effective_start` datetime(0) NULL DEFAULT CURRENT_TIMESTAMP(0) COMMENT '有效时间开始',
  `effective_end` datetime(0) NULL DEFAULT CURRENT_TIMESTAMP(0) COMMENT '有效时间结束',
  `settle_price` decimal(10, 2) NOT NULL DEFAULT 0.00 COMMENT '结算价格（流量主）',
  `balance` decimal(10, 2) NOT NULL DEFAULT 0.00 COMMENT '保证金（可用）金额 单位 元',
  `lock_balance` decimal(10, 2) NOT NULL DEFAULT 0.00 COMMENT '保证金（锁定）金额 单位 元',
  `flow_status` tinyint(2) NOT NULL DEFAULT 1 COMMENT '流量主状态（0，禁用，1，启用）',
  `commission_balance` decimal(10, 2) NOT NULL DEFAULT 0.00 COMMENT '佣金余额',
  `ad_status` tinyint(2) NOT NULL DEFAULT 1 COMMENT '广告主状态（0，禁用，1，启用）',
  `is_flow` tinyint(2) NOT NULL DEFAULT 0 COMMENT '是否为流量主（0. 否，1.是）',
  `is_ad` tinyint(2) NOT NULL DEFAULT 0 COMMENT '是否为广告主（0. 否，1. 是）',
  `ad_master_type` tinyint(2) NOT NULL DEFAULT 0 COMMENT '广告主账号类型（1：电商用户）',
  `flow_source_type` tinyint(2) NOT NULL DEFAULT 0 COMMENT '流量主来源（1. 多谋，2. 达人互动）',
  `notify_min_balance` decimal(10, 2) NOT NULL DEFAULT 0.00 COMMENT '触发余额不足提醒最小保证金金额 单位 元',
  `is_notify` tinyint(2) NOT NULL DEFAULT 0 COMMENT '是否触发余额不足提醒 0否 1是',
  `notify_phone` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '通知人手机号',
  `notify_name` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '通知人姓名',
  `create_time` datetime(0) NULL DEFAULT CURRENT_TIMESTAMP(0) COMMENT '创建时间',
  `update_time` datetime(0) NULL DEFAULT CURRENT_TIMESTAMP(0) ON UPDATE CURRENT_TIMESTAMP(0) COMMENT '修改时间',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `third_platform_id`(`third_platform_id`) USING BTREE COMMENT '第三方Id',
  INDEX `company_id`(`company_id`) USING BTREE COMMENT '公司Id',
  INDEX `guid`(`guid`) USING BTREE COMMENT '商户表唯一Id',
  INDEX `trade_id`(`trade_id`) USING BTREE COMMENT '行业Id'
) ENGINE = InnoDB AUTO_INCREMENT = 33 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '用户商户表' ROW_FORMAT = Compact;

-- ----------------------------
-- Records of sys_user_merchant
-- ----------------------------

-- ----------------------------
-- Table structure for sys_user_merchant_log
-- ----------------------------
DROP TABLE IF EXISTS `sys_user_merchant_log`;
CREATE TABLE `sys_user_merchant_log`  (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键，自增',
  `operate_user_id` bigint(20) NULL DEFAULT 0 COMMENT '操作人id',
  `operate_user_name` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '操作人Name',
  `merchant_guid` bigint(20) NOT NULL DEFAULT 0 COMMENT '商户表guid',
  `operate_type` bigint(2) NULL DEFAULT 0 COMMENT '操作类型（1. 启用，2. 禁用，3. 修改）',
  `source` bigint(2) NULL DEFAULT 0 COMMENT '来源：1. 广告主，2. 流量主',
  `content` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '操作内容/细节',
  `update_time` datetime(0) NULL DEFAULT CURRENT_TIMESTAMP(0) ON UPDATE CURRENT_TIMESTAMP(0) COMMENT '修改时间',
  `create_time` datetime(0) NULL DEFAULT CURRENT_TIMESTAMP(0) COMMENT '创建时间',
