-- ----------------------------
-- Table structure for wm_template_decoration
-- ----------------------------
DROP TABLE IF EXISTS `wm_template_decoration`;
CREATE TABLE `wm_template_decoration`  (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `state` tinyint(4) NOT NULL DEFAULT 1 COMMENT '数据状态，0 = 已删除，1 = 正常',
