  `update_time` timestamp(0) NOT NULL DEFAULT CURRENT_TIMESTAMP(0) ON UPDATE CURRENT_TIMESTAMP(0) COMMENT '更新时间',
  `mall_id` bigint(20) NULL DEFAULT NULL COMMENT '商城id',
  `shop_id` bigint(20) NULL DEFAULT NULL COMMENT '门店ID，属于门店创建的此处才有值，否则为null',
  `template_guid` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '模板GUID',
  `template_name` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '模板名称',
  `template_type` tinyint(4) NOT NULL COMMENT '模板类型，1 = 首页装修模板 ， 2 = 自定义页面模板',
  `style` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL,
  `content` blob NOT NULL COMMENT '模板内容',
  `footer_menu` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '底部菜单',
  `is_system` tinyint(4) NOT NULL DEFAULT 0 COMMENT '是否系统自带模板， 0 = 否，1 = 是',
