  `shop_mode` int(1) NOT NULL DEFAULT 1 COMMENT '1:单门店;2:多门店',
  `shop_ids` text CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '模板配置门店',
  `login_account` varchar(30) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '登录帐号',
  `user_name` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '姓名',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE INDEX `guid`(`template_guid`) USING BTREE,
  INDEX `state`(`state`) USING BTREE,
  INDEX `companyGuid`(`mall_id`) USING BTREE,
  INDEX `shop_id`(`shop_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 335 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '首页模板和自定义页面模板配置表' ROW_FORMAT = Compact;

